import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

export default function Navegation(){

    if (state) {
        return (
            <Router>
                <Link to="/"><button >Ingresar</button></Link>
                <Link to="/about">Registrarse</Link>
                        
                <Switch>
                    <Route path="/about"></Route>
                    <Route path="/users">{console.log(`click en Registrar`)}</Route>
                    {console.log(`ingreso por aca`)}
                </Switch>
            </Router>
        )
    }
    else {
        return (
            <Router>
                <Link to="/"><button>Ingresar</button></Link>
                <Link to="/about">Registrarse</Link>
                        
                <Switch>
                    <Route path="/about">{console.log(`click en Ingresar`)}</Route>
                    <Route path="/users">{console.log(`click en Registrar`)}</Route>
                </Switch>
            </Router>
        )
    }
}
